import React from 'react'
import { AuthContext } from '../AuthContex'

function User() {
  const auth=AuthContext;
  const handleOut=()=>{auth.logout()}
  return (
    <div>
        <button onClick={handleOut}>LOGOUT</button>
    </div>
  )
}

export default User
